
function GPSWidget(broker) {
  var position, heading, route;

  broker.sub("display_nav_map", function(data) {
    var map = renderGPS();
    if (data.route) {
      map.setRoute(data.route);
    }

    if (data.zoomOut) {
      map.setZoom(2);
      if (data.zoomOutDuration) {
        setTimeout(map.setZoom.bind(null, 20), data.zoomOutDuration);
      }

    }

    broker.getSocket().emit('subscribe', {
      name: "car/telemetry"
    });

    function translatePoint(point) {
      // needs sliiiiight calibration.
      return {
        x: -.121 * point.x,
        y: .1223 * point.y
      };
    }

    function toRadians(degrees) { return degrees * (Math.PI / 180); }
    function toDegrees(radians) { return radians * (180 / Math.PI); }

    function mirrorAngleAroundYAxis(theta) {
      var headingInRadians = toRadians(theta);
      var newAngle = {
        x: -Math.cos(headingInRadians),
        y: Math.sin(headingInRadians)
      };

      return toDegrees(Math.atan2(newAngle.y, newAngle.x));
    }

    broker.getSocket().on('car/telemetry', function(e) {
      var inputAngle = e.heading + 180;
      while (inputAngle > 360) {
        inputAngle -= 360;
      }

      heading = mirrorAngleAroundYAxis(inputAngle);
      position = translatePoint({x: e.location.x, y: e.location.y});
      map.setState({xOffset: position.x, yOffset: position.y, orientation: heading});
    });

    broker.sub("show_alt_route", function(data) {
      route = data.route;
      map.setRoute(data.route);
    }, "CC");

    broker.sub("zoom_out", function(data) {
      map.setZoom(2);
      setTimeout(map.setZoom.bind(null, 20), data.duration);
    });

    broker.sub("zoom_in", function() {
      map.setZoom(20);
    });

    if (position) {
      map.setState({xOffset: position.x, yOffset: position.y, orientation: heading});
    }

    if (route) {
      map.setState({route: route});
    }

  }, "CC");

  function renderGPS() {

    // <label>Zoom:<input type="range" min="1" max="10" value="1" step=".25" id="zoom"/></label>Rotation:<input type="range" min="-180" max="180" step="1" id="orientation"/></label><label>X<input type="range" min="-1000" max="1000" step="1" value="0" id="xOffset"/></label><label>Y<input type="range" min="-1000" max="1000" value="0" step="1" id="yOffset"/></label>
    // <path d="M363,0 L364,836" style="stroke:#f00; fill: none;"/><path d="M0,418 L728,418" style="stroke:#f00; width:2px; fill: none;"/>
    $("#1").empty().append('<div><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" class="map" id="mapScale"  xml:space="preserve"><g id="mapRoot"></g></svg></div>');
    var view = React.render(<GPSMap />, document.getElementById("mapRoot"));

    //  (0, 0)              origin
    //  (582.54, -941.017)  starting point
    //  (170.227, -979.295) first turn
    //  (166.394, -881.397) first intersection after turn
    //  (158.161, -784.177) second interserction after turn
    //  (137.286, -580.887) fourth intersection after turn
    //  (70.462, -90.283)   big turn at the end of hte straightaway
    //  (978.137, 88.912)   last intersection before end
    //  (1063.161, 98.265)  end
    return view;
  }


}

widgets.push({fn: GPSWidget, channel: "CC"});


var GPSMap = React.createClass({
  getInitialState: function() {
    return {
      route: "favorite",
      xOffset: 0,
      yOffset: 0,
      orientation: 0,
      zoom: 20
    }
  },
  setZoom: function(zoom) {
    this.setState({zoom: zoom});
  },
  setRoute: function(route) {
    this.setState({route: route})
  },
  render: function() {
    var route;
    if (this.state.route === "favorite") {
      route = <FavoriteRoute />
    } else if (this.state.route === "economic") {
      route = <EconomicRoute />
    } else if (this.state.route === "choice") {
      route = <RouteChoice />
    }

    var redLine = {
      stroke: "#f00"
    };

    var scale = this.state.zoom;

    var initialOffset = {
      x: 186,
      y: -62.5
    };

    var offset = {
      x: (initialOffset.x + Number(this.state.xOffset)) * scale,
      y: (initialOffset.y + Number(this.state.yOffset)) * scale
    };

    //avoid hardcoded dimensions, appropiate definition comes from _demo.scss
    var w = window.getComputedStyle(document.getElementById("mapScale")).getPropertyValue('width').slice(0,-2);
    var h = window.getComputedStyle(document.getElementById("mapScale")).getPropertyValue('height').slice(0,-2);

    var viewDimensions = {
      width: w,
      height: h
    };

    var rootDimensions = {
      width: 680.9998779,
      height: 768.800354
    };

    var scaledDimensions = {
      width: rootDimensions.width * scale,
      height: rootDimensions.height * scale
    };

    // the offset is what recenters this over the desired origin, so I can try to overlay origins
    var origin = {
      x: ((viewDimensions.width - scaledDimensions.width) / 2) + offset.x,
      y: ((viewDimensions.height - scaledDimensions.height) / 2) + offset.y
    };

    var axis = {
      x: origin.x - offset.x + (scaledDimensions.width / 2),
      y: origin.y - offset.y + (scaledDimensions.height / 2)
    };

    var rawOffset = {
      x: this.state.xOffset,
      y: this.state.yOffset
    };

    var carOffset = {
      x: viewDimensions.width / 2,
      y: viewDimensions.height / 2
    };

    var rotator = "rotate(" + this.state.orientation + "," + viewDimensions.width/2 + ", " + viewDimensions.height/2 +")";
    var translator = "translate(" + (origin.x) + ", " + (origin.y) + ")";
    var scaler = "scale(" + scale + ")";
    var carTransform = "translate(" + carOffset.x + "," + carOffset.y + ") scale(" + (scale * .02) + ")";
    return (<g>
              <g transform={rotator}>
                <g transform={translator}>
                  <g transform={scaler}>
                    <Map />
                    {route}
                    <GoalIndicator />
                  </g>
                </g>
              </g>
              <g transform={carTransform}>
                <Car />
              </g>
            </g>);
  }

});

